import React, { Component } from 'react'

export default class map extends Component {
    constructor(){
        super()
        this.state={
            list:[
                {name:'jaydeep',email:'jaydeep@test.in'},
                {name:'abc',email:'abc@test.in'}
            ]
        }
    }
    render() {
        return (
            <div>
            <h1>{
                this.state.list.map((item)=>{
                    <div>
                        {item.name}
                    </div>
                })
            }</h1>

            </div>
        )
    }
}
